description:
Water filling line LR 5-500 is destined for: automatic filling of water into PET bottles and plastic containers with volume 5-10L, automatic capping by a plastic screw caps, gluing of one or several self-adhesive labels.

Filling of water is executed by volume. Dosing accuracy - 0.5-1% is controlled by an individual electronic counter that is installed on each filling device. Line is completed with electromechanical capping.

Automatic filling of water into PET bottles :
- number of filling devices is 4; 
- control processor by Mitsubishi, Japan; 
- electronic level sensors; 
- pneumatically controlled filling valves by BURKERT, Germany; 
- pneumatic equipment by CAMOZZI, Italy; 
- frequency converter by Mitsubishi, Japan; 
- automatic cap orientators on the bottle; 
- device for last straw elimination; 
- production material - stainless steel AISI 304, Germany; 
- price - 28 800 €. 

Connective conveyors:
- stainless steel, chain and fastenings by UNI KETTENTECHNIK, Denmark (length-4,5m.); 
- reductor by MOTOVARIO, Italy; 
- engine by Siemens, Germany. 

Optional equipment:
- equipment for blowing of PET bottles; 
- equipment for packaging of the finished products in shrink film; 
- equipment for packaging and gluing of the finished products in cardboard boxes.

